-- Tailoring Management System Database
-- Generated: 2026-01-06 10:26:06
-- Total Records: 435

BEGIN TRANSACTION;
CREATE TABLE customers (
    customer_id INTEGER PRIMARY KEY,
    customer_name TEXT NOT NULL,
    total_orders INTEGER DEFAULT 0,
    total_spent REAL DEFAULT 0,
    avg_satisfaction REAL DEFAULT 0,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);
CREATE TABLE deliveries (
    delivery_id INTEGER PRIMARY KEY AUTOINCREMENT,
    order_id INTEGER,
    delivery_type TEXT,
    expected_date DATE,
    actual_date DATE,
    delivered_quantity INTEGER,
    days_difference INTEGER,
    status TEXT DEFAULT 'Pending',
    FOREIGN KEY (order_id) REFERENCES orders(order_id)
);
CREATE TABLE orders (
    order_id INTEGER PRIMARY KEY,
    customer_id INTEGER,
    tailor_id TEXT,
    order_date DATE,
    order_type TEXT,
    tailoring_style TEXT,
    size TEXT,
    quantity INTEGER,
    length_cm REAL,
    width_cm REAL,
    sleeve_cm REAL,
    fabric_meters REAL,
    price_per_unit REAL,
    fabric_price_per_meter REAL,
    total_amount REAL,
    tax REAL,
    discount REAL,
    expected_delivery_days INTEGER,
    satisfaction INTEGER,
    dissatisfaction_reason TEXT,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (customer_id) REFERENCES customers(customer_id),
    FOREIGN KEY (tailor_id) REFERENCES tailors(tailor_id)
);
CREATE TABLE predictions (
    prediction_id INTEGER PRIMARY KEY AUTOINCREMENT,
    order_id INTEGER,
    predicted_price REAL,
    predicted_length REAL,
    predicted_satisfaction INTEGER,
    predicted_delivery_days INTEGER,
    prediction_date TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (order_id) REFERENCES orders(order_id)
);
CREATE TABLE tailors (
    tailor_id TEXT PRIMARY KEY,
    tailor_name TEXT NOT NULL,
    total_orders INTEGER DEFAULT 0,
    avg_rating REAL DEFAULT 0,
    specialization TEXT
);
CREATE INDEX idx_orders_customer ON orders(customer_id);
CREATE INDEX idx_orders_date ON orders(order_date);
CREATE INDEX idx_deliveries_order ON deliveries(order_id);
DELETE FROM "sqlite_sequence";
COMMIT;
